from collections import deque

def solve():
    n = int(sys.stdin.readline())
    s = []
    for _ in range(n):
        s.append(sys.stdin.readline().strip())

    player1_coords = None
    player2_coords = None

    for i in range(n):
        for j in range(n):
            if s[i][j] == 'P':
                if player1_coords is None:
                    player1_coords = (i, j)
                elif player2_coords is None:
                    player2_coords = (i, j)
                    break
        if player2_coords is not None:
            break

    if player1_coords is None or player2_coords is None:
        print(-1)
        return

    if player1_coords == player2_coords:
        print(0)
        return

    q = deque([(player1_coords, 0)])
    visited = {player1_coords}

    while q:
        (row, col), dist = q.popleft()

        moves = [(0, 1), (0, -1), (1, 0), (-1, 0)]
        for dr, dc in moves:
            new_row, new_col = row + dr, col + dc
            if 0 <= new_row < n and 0 <= new_col < n and (new_row, new_col) != player2_coords and (new_row, new_col) not in visited:
                if s[new_row][new_col] == 'P':
                    if (new_row, new_col) == player2_coords:
                        print(dist + 1)
                        return
                    q.append(((new_row, new_col), dist + 1))
                    visited.add((new_row, new_col))

    print(-1)

if __name__ == "__main__":
    solve()

